import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/footer';
import Home from './components/Home';
import Login from './auth/Login';
import Register from './auth/Register';
import AdminDashboard from './admin/AdminDashboard';
 import MedecinDashboard from './pages/MedecinDashboard';
 import CreateDossier from './pages/CreateDossier';
 import MesDossiers from './pages/MesDossiers';

function App() {
  return (
    <div className="min-h-screen flex flex-col">
      <Navbar />
      <main className="flex-grow">
        <Routes>
          {/* Pages publiques */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          {/* Dashboard Admin (protégé) */}
          <Route
            path="/admin"
            element={
              <PrivateRoute allowedRoles={['Admin', 'SuperAdmin']}>
                <AdminDashboard />
              </PrivateRoute>
            }
          />


               {/* Médecin */}
         <Routes>
        <Route path="/medecin" element={<MedecinDashboard />} />
        <Route path="/medecin/create-dossier" element={<CreateDossier />} />
        <Route path="/medecin/mes-dossiers" element={<MesDossiers />} />
      </Routes>





          {/* Redirection par défaut */}
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </main>
      <Footer />
    </div>
  );
}

export default App;
